/* istanbul ignore file */
/* tslint:disable */
/* eslint-disable */
import type { ImgUrl } from '../models/ImgUrl';
import type { JobStatus } from '../models/JobStatus';
import type { JobStatusType } from '../models/JobStatusType';
import type { RequestJobCancel } from '../models/RequestJobCancel';
import type { SharedJobResponse } from '../models/SharedJobResponse';
import type { SharedJobResults } from '../models/SharedJobResults';
import type { CancelablePromise } from '../core/CancelablePromise';
import { request as __request } from '../core/request';

export class JobService {

    /**
     * Get Job Status
     * @param jobId
     * @returns JobStatus Successful Response
     * @throws ApiError
     */
    public static getJobStatusJobJobIdStatusGet(
        jobId: string,
    ): CancelablePromise<JobStatus> {
        return __request({
            method: 'GET',
            path: `/job/${jobId}/status`,
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Get Jobs With Status
     * @param statusType
     * @returns string Successful Response
     * @throws ApiError
     */
    public static getJobsWithStatusJobStatusTypeGet(
        statusType: JobStatusType,
    ): CancelablePromise<Array<string>> {
        return __request({
            method: 'GET',
            path: `/job/${statusType}`,
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Cancel Job
     * @param jobId
     * @param requestBody
     * @returns void
     * @throws ApiError
     */
    public static cancelJobJobJobIdPatch(
        jobId: string,
        requestBody: RequestJobCancel,
    ): CancelablePromise<void> {
        return __request({
            method: 'PATCH',
            path: `/job/${jobId}`,
            body: requestBody,
            mediaType: 'application/json',
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Cancel Jobs
     * @param requestBody
     * @returns any Successful Response
     * @throws ApiError
     */
    public static cancelJobsJobPatch(
        requestBody: Array<string>,
    ): CancelablePromise<any> {
        return __request({
            method: 'PATCH',
            path: `/job`,
            body: requestBody,
            mediaType: 'application/json',
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Get Shared Results
     * @param id
     * @param signature
     * @returns SharedJobResults Successful Response
     * @throws ApiError
     */
    public static getSharedResultsShareResultsIdGet(
        id: string,
        signature: string,
    ): CancelablePromise<SharedJobResults> {
        return __request({
            method: 'GET',
            path: `/share/results/${id}`,
            query: {
                'signature': signature,
            },
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Generate Job Results
     * @param jobId
     * @returns SharedJobResponse Successful Response
     * @throws ApiError
     */
    public static generateJobResultsJobJobIdResultsGet(
        jobId: string,
    ): CancelablePromise<SharedJobResponse> {
        return __request({
            method: 'GET',
            path: `/job/${jobId}/results`,
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Get Image Url
     * @param jobId
     * @returns ImgUrl Successful Response
     * @throws ApiError
     */
    public static getImageUrlJobJobIdImgUrlGet(
        jobId: string,
    ): CancelablePromise<ImgUrl> {
        return __request({
            method: 'GET',
            path: `/job/${jobId}/img-url`,
            errors: {
                422: `Validation Error`,
            },
        });
    }

}
